import React from 'react';

import {ListGroup,Button,Dropdown} from 'react-bootstrap';

function authority(){
    return(
        <div>
    <ListGroup>
         <ListGroup.Item>Add</ListGroup.Item>
         <ListGroup.Item>Modify</ListGroup.Item>
         <ListGroup.Item>Delete</ListGroup.Item>
         <ListGroup.Item>View</ListGroup.Item>
         <ListGroup.Item>Clear</ListGroup.Item>{' '}
    </ListGroup>

    <Dropdown>
        <Dropdown.Toggle variant="secondary" id="dropdown-basic">Dropdown Button</Dropdown.Toggle>

     <Dropdown.Menu>
        <Dropdown.Item >Add</Dropdown.Item>
        <Dropdown.Item >Modify</Dropdown.Item>
        <Dropdown.Item >Delete</Dropdown.Item>
        <Dropdown.Item >View</Dropdown.Item>
        </Dropdown.Menu>
    </Dropdown>


    <div classs="text-center">
    <Button variant="info" type=" save "> 
      save
    </Button>{' '}

    <Button variant="danger" type=" save "> 
    Delete
  </Button>{' '}
  </div>

  <div class="text-center">
  <Button variant="primary" type=" save "> 
  Remove Modify Right 
  </Button>{' '}

  
  <Button variant="secondary" type=" save "> 
  View All 
  </Button>{' '}
  </div>
    </div>
   
    );
}
export default authority;
